    add_205771(tmp_289302, experience_288668(makeNimstrLit("Indigitall"), [makeNimstrLit("        Indigitall is a startup located in Madrid, the company focused on its Push Notifications As a Service, again, my job was\x0A        to maintain and upgrade the backend they had in PHP, Symfony toom and I managed the servers too.\x0A        "), makeNimstrLit("        What I learnt the most here was to interact with clients. Because we where just 3 people, and we had big clients, I\x0A        had to email with clients, go to their offices, etc.\x0A        "), makeNimstrLit("        We had some interesting performance challenges, when Orange became a client, we instantly had 2 to send push notifications\x0A        to two million users, that was fun.\x0A        "), makeNimstrLit("        Although I was very happy here, I was not happy with the lifestyle in Madrid, and our house was too small, and the big distances!\x0A        Finally a chance to come back to M\xC3\xA1laga knocked my door, and in less than 2 weeks, I was back in M\xC3\xA1laga.\x0A        ")]));
